import Layout from '../components/layout';
import ItemInstance from '../models/iteminstance';
import ItemsInIndex from '../components/itemsInIndex';
import { useItems } from './contexts/ProductsContext';
import { usedispatch } from './contexts/ProductsContext';
import { useUser } from './contexts/userContext';
import { useEffect } from 'react';

export default function Iteminstances() {
  var iteminstances = [];
  const state = useItems();
  const dispatch = usedispatch();
  const user = useUser();

  useEffect(async () => {
    var result = await ItemInstance.find({ user: user });
    iteminstances = JSON.parse(JSON.stringify(result));
  });

  return (
    <Layout>
      {/* Create a card for each item */}
      <div className='card-columns'>
        {iteminstances.map((iteminstance) => (
          <Iteminstance iteminstance={iteminstance} key={iteminstance._id} />
        ))}
      </div>
    </Layout>
  );
}
